PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE SourceType(label VARCHAR PRIMARY KEY, value INTEGER);
CREATE TABLE TypeOfData(label VARCHAR PRIMARY KEY, value INTEGER);
CREATE TABLE Organization(label VARCHAR PRIMARY KEY, value INTEGER);
CREATE TABLE DataType(label VARCHAR PRIMARY KEY, value INTEGER);
CREATE TABLE GridType(label VARCHAR PRIMARY KEY, value VARCHAR);
CREATE TABLE MissingValue(pluginName VARCHAR PRIMARY KEY, value REAL);
CREATE TABLE etiket(pluginName VARCHAR PRIMARY KEY, label VARCHAR);
CREATE TABLE unitCorrespondance (label VARCHAR PRIMARY KEY, unit VARCHAR);
CREATE TABLE LevelType(label VARCHAR PRIMARY KEY, kind INTEGER, followTopography BYTE, surfaceLevel VARCHAR);
CREATE TABLE stdvar (name VARCHAR PRIMARY KEY, description_fr VARCHAR not null constraint not_empty check (description_fr != ''), description_en VARCHAR not null constraint not_empty check (description_en != ''), unit VARCHAR not null constraint not_empty check (unit != ''));
CREATE VIEW v_etiket as select label,pluginName from etiket;
COMMIT;
